import React, { useEffect, useState } from 'react';

function Showmachine({shownMachine, setStage}) {

    const HandleClick = () => {
        setStage("maintenance")
    }

    const ShowTime = (shownMachine) => {
        if (shownMachine.time != null) {
            var showTime = "Ingen Tid"
        }
        else {
            var showTime = shownMachine.time
        }
    }

    return(
        <div>
            <button id="backbutton" onClick={HandleClick}>Tilbage</button>
            <p>{shownMachine.id}</p>
            <p>{shownMachine.pumpname}</p>
            <p>{showTime}</p>
            <p>{shownMachine.active}</p>
        </div>
    )
}
export default Showmachine;
